  [],\n\t\"revision_timestamp\": \"2015-05-07T03:43:52.466614\",\n\t\"name\": \"multi-element-lean-direct-injection-combustor-module-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"We propose to develop a Multi-Element Lean
  Direct Injection, ME-LDI, Combustion concept with the following innovative features:rn1.tIndependent,
  mini burning zones created by containing the flame in a cylinder downstream of each
  fuel injector/swirler element in a multiple fuel injector array, see figure 1.  The
  independent burning zones will enable fuel staging the fuel injectors (turning off
  fuel to selected fuel injectors) to cover the operating cycle, such that at each
  point of the operating cycle the combustor will have high combustion efficiency
  (&gt;99&#37;) and low NOx emissions. At high power conditions the combustion efficiency
  should be greater than 99.9&#37;.rn2.tA low flow number, \"Butterfly\" fuel injector
  will be incorporated into ME-LDI that is low cost and simple to manufacture but
  a highly effective atomizer.  The term \"Butterfly\" derives from the butterfly
  shape of the spray.  The shape of the spray is formed by two diametrically opposed
  slots cut through a closed end fuel tube, see figure 2.  The fuel flow through each
  slot forms a fan spray.  The slot width can be varied to control drop-sizes within
  the spray.   rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
